import { createSlice, createAsyncThunk } from '@reduxjs/toolkit'

const initialState = {
  notes: [],
  note: {},
  isSuccess: false,
  isError: false,
  isLoading: false,
  message: ''
}

export const noteSlice = createSlice({
  name: 'note',
  initialState,
  reducers: {
    reset: (state) => initialState
  }
})

export default noteSlice
